INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (21, '1998-08-01 00:00:00', 'Mobile Suit Gundam Wing: Endless Waltz', 'After Colony 196 - Um ano se passou após a batalha entre a Terra e suas colônias. Heero, Duo, Trowa e Quatre enviam seus Gundams em direção ao sol. Relena Darlian é agora a ministra da Nação Unificada da Terra. Mas como os pilotos de Gundams estão ajustando à paz na Terra, Relena é sequestrada e uma nova ameaca aparece, conduzida por Mariemaia Khushrenada - a filha do recente ditador Treize Khushrenada e herdeira da Fundação Barton. Tornando ainda mais complicado, o piloto do Gundam Nakatu WuFei apoia essa discórdia. Os pilotos de Gundam conseguem recuperar os seus mobile suits e mais uma vez tentarão nessa batalha com Mariemaia impedir sua dominação global.');
