INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (24, '1986-09-06 00:00:00', 'Sonhos da Ópera de Pequim', 'Cinco personagens se unem pelo acaso e com diferentes interesses, em meio aos conflitos políticos na Pequim da década de 20.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (25, '2008-11-26 00:00:00', 'Surpresas do Amor', 'Todo Natal Brad (Vince Vaughn) e Kate (Reese Whiterspoon) seguem uma tradição criada desde quando se conheceram: livram-se das neuroses de suas famílias e viajam para algum local exótico e ensolarado, onde possam passar as férias. Só que neste ano eles não podem seguir o plano, já que um nevoeiro cancela todos os vôos do aeroporto de San Francisco. Para piorar eles são filmados por uma equipe local de notícias, o que faz com que suas famílias saibam onde estão. Sem terem como escapar, eles são obrigados a passar o Natal com suas famílias. Quatro vezes, já que precisam lidar com o pai e a mãe de cada um deles.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (26, '1941-01-03 00:00:00', 'Amor da Minha Vida', 'Quando os "eternos" estudantes universitários Danny O''Neill e Hank Taylor são forçados a viver por conta própria, a competitiva dupla consegue emprego temporário com a banda de Artie Shaw. Danny e Hank são surpreendidos quando Artie Shaw contrata a competente gerente Ellen Miller que era lá da sua banda de faculdade. O dois trompetistas tentam esquemas para se enquadrar na banda de Shaw, cada um tentando sabotar a jogada do outro.');
