INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (38, '2008-09-07 00:00:00', 'O Lutador', 'Randy "Carneiro" Robinson (Mickey Rourke) é um solitário e famoso lutador de wrestler que se sustenta através das lutas e também de "bicos" que faz em um mercado local. Após um intenso combate, Randy sofre um infarto e, depois de uma cirurgia, é informado que corre risco de morte se voltar a praticar atividades físicas. Assustado, ele procura dividir sua angústia com uma stripper (Marisa Tomei), por quem nutre um desejo e, que o ajuda a retomar o contato com Stephanie (Evan Rachel Wood), a filha abandonada por ele. Dividido entre um passado de glória e um futuro incerto, Randy se vê pressionado a retornar ao ringue para uma importante revanche que pode mudar a sua vida.');
