INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (66, '1997-03-28 00:00:00', 'O 6º Homem', 'Antoine e Kenny Tyler são jogadores de basquete universitário da NCAA, e Antoine é a estrela. De repente Antoine morre de ataque cardíaco e Kenny tem substitui-lo como líder de equipe. Algum tempo depois, Antoine retorna como um fantasma e ajuda Kenny no jogo e na vida, mas Kenny muda no processo e não gosta muito dele.');
