INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (69, '1962-06-20 00:00:00', 'Pistoleiros do Entardecer', 'O mundo está mudando e para um velho homem da lei como Steve Judd, não há muitas oportunidades de trabalho. Ele aceita trabalho de um banco para transportar um carregamento de ouro através de um território perigoso. Ele contrata o velho parceiro Gil Westrum e seu jovem pupilo Heck para ajudá-lo. Mas não sabe que Gil e Heck planejam roubar o ouro com ou sem a sua ajuda. Na fuga, os três se envolvem no desejo de uma jovem mulher de escapar tanto de seu pai como de seu noivo e seus irmãos perigosamente psicóticos.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (70, '1987-10-01 00:00:00', 'Meu Doce Vampiro', 'O jovem estudante encontra-se transformado em vampiro depois de uma noite com uma vampira feminina bastante atraente. Primeiro, ele não acredita muito ele mesmo, mas com a ajuda de um professor de 300 anos e o manual "vampirismo - um guia para um estilo de vida alternativo", ele descobre que o sangue não é tão mau como ele esperava.');
