INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (77, '2005-10-25 00:00:00', 'Street Fighter Alpha: Generations', 'Street Fighter Alpha: Generations (também creditado como Street Fighter Zero: Generations) é um filme de animação japonês de 2005 dirigido por Ikuo Kuwana e produzido pela Capcom.  O filme é uma OVA baseado em alguns personagens da série de jogos Street Fighter Alpha. Diferentemente dos outros dois animes lançados anteriormente pela Capcom, esse fora produzido nos EUA e Japão por uma equipe japonesa, nos estúdios da A.P.P.P.[1], porém a distribuição ficou a cargo novamente da Manga Entertainment.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (78, '1943-01-07 00:00:00', 'Jornada do Pavor', 'Howard Graham e sua esposa Stephanie acabam de chegar em um hotel em Istambul. Howard é engenheiro de uma empresa americana que fornece armas para a marinha turca. É levado a uma casa de shows por Kopeikin, representante local da empresa, quando durante a apresentação de um número de mágica, o próprio mágico é morto. O coronel Haki, da polícia secreta turca, o informa que o atirador é um agente nazista que pretende eliminá-lo. Haki crê ser mais seguro embarcá-lo em um navio com destino a Batumi, mas os agentes o perseguem.');
