INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (87, '2008-12-25 00:00:00', 'O Amante', 'Peter (Liam Neeson) e Lisa (Laura Linney) são casados e levam uma vida pacata. Ele dirige sua própria companhia, enquanto que ela é designer de sapatos. Até que, na festa de lançamento de sua última coleção, Lisa pergunta a Peter se jamais desejara ficar com outra pessoa. Logo em seguida desaparece, o que o leva ao desespero. Tentando encontrá-la ele segue à Itália, onde conhece Ralph (Antonio Banderas). Peter sabe que ele é o amante de sua esposa, mas Ralph guarda alguns segredos.');
