INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (123, '2002-01-01 00:00:00', 'As Bruxas de Salem', '1691, Salem. Algumas garotas iniciaram um período de terror enorme quando disseram que padeciam de sofrimentos demoníacos. A comunidade assustada acreditou na explicação das meninas, que diziam que foram "possuídas" por bruxas que viviam dentro na comunidade puritana. O reverendo Samuel Parris (Henry Czerny) e outros líderes comunitários começam uma inumana caça às bruxas. Logo ninguém estava livre de suspeitas, mas só mulheres do povoado foram acusadas. Ann Putnam (Kirstie Alley), seguiu os passos da sua filha, Annie (Katie Boland), que aparentemente foi tomada por visões estranhas e publicamente acusou de bruxaria uns vizinhos. Rebecca Nurse (Shirley MacLaine), uma religiosa fervorosa e uma amável anciã da comunidade, é um das mulheres que foi vítima das acusações de Ann. Entretanto Rebecca não foi a primeira nem seria a última deste tribunal, que agora também condenava homens para serem enforcados, pelo simples fato de terem se oposto aos métodos usados para apurar a ''verdade''.');
