INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (144, '2004-08-04 00:00:00', 'Mickey, Donald e Pateta – Os Três Mosqueteiros', 'A Clássica história dos Três Mosqueteiros nunca foi tão divertida. Acompanhe os inseparáveis Mickey, Donald e Pateta quando eles resolvem ser mosqueteiros e têm que proteger a Princesa Minnie das garras do dissimulado Bafo de Onça. Aprenda valiosas lições sobre amizade e o verdadeiro sentido de um por todos e todos por um!, no primeiro longa-metragem da história de Mickey Mouse.');
