INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (147, '2006-01-06 00:00:00', '15 Park Avenue', 'Uma exploração do impacto da esquizofrenia em uma jovem e sua família na atual Calcutá. A narrativa gira em torno do relacionamento de duas irmãs, a irmã mais velha Anjali é uma professora de sucesso com uma personalidade poderosa. Ela é a pedra de ancoragem para sua família e cuidadora de sua irmã Meethi, cuja progressão para a esquizofrenia foi acelerada por experiências traumáticas. Anjali sempre dominou a vida de sua atraente irmã mais nova e, com inveja, afastou Jogo, o noivo bonito de Meethi, com medo da doença iminente de Meethi. Anos mais tarde, quando Meethi e Anjali estão de férias nas colinas, há um encontro casual com Jojo, agora com sua nova esposa e filhos. Ele fica chocado ao descobrir que Meethi agora não o reconhece, mas vive em um mundo visitado por um marido imaginário e seus próprios filhos.');
