INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (151, '2006-02-27 00:00:00', 'Em Busca Do Vale Encantado XII O Grande Dia dos Voadores', 'No filme Em Busca Do Vale Encantado XII O Grande Dia dos Voadores,Em Busca do Vale Encantado XII: O Grande Dia dos Voadores é um filme para toda a família, mostrando de maneira poética e didática os problemas enfrentados pelas crianças, como a aceitação das diferenças entre elas. Petrie está passando por dificuldades para preparar o Dia dos Voadores: um evento importante para todos os animais voadores do Grande Vale, onde os jovens animais têm que fazer um vôo perfeito para provar que podem acompanhar os adultos. Petrie, um sujeito muito ansioso, tem problemas para voar em formação junto com os outros – ele faz mais o tipo radical, com vôos radicais bem ao seu jeito. Ao mesmo tempo, uma estranha figura chega ao Grande Vale, mas Littlefoot e seus amigos querem saber de quem se trata. Baixe e saiba mais!');
