INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (153, '2002-10-30 00:00:00', 'As Loucas Aventuras de Elvira', 'Elvira e a sua serva voltam a criar desacatos, dessa vez em uma mansão dominada por fantasmas. A história é ambientada em 1851, em Carpathia. Lá, ambas estão a caminho de um espetáculo da “Mistress of Dark”, mas, inadvertidamente, vão parar no sinistro castelo medieval do Lord Vladimere Hellsubus. Continuação do clássico de 1988, "Elvira, a Rainha das Trevas".');
