INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (158, '2005-02-20 00:00:00', 'Crimes no Paraíso', 'Um ex-detetive de homicídios de Los Angeles, Jesse Stone (Tom Selleck), deixou o emprego e o casamento para se tornar chefe de polícia em Paradise, Massachussetts, uma cidade com pouco mais de 25 mil habitantes. A tranquilidade do lugar é quebrada quando um policial, Luther Simpson (Kohl Sudduth), encontra nas rochas perto do mar o corpo de Kenneth Eisley (Chris Killam), que foi morto com dois tiros no peito. Paralelamente uma jovem, Candace Pennington (Alexis Dziena), é estuprada por "colegas" de colégio. Logo depois Barbara Carey (Cindy Sampson) é morta da mesma forma. Não há a menor conexão entre Kenneth e Barbara, pois os crimes estão sendo cometidos de forma totalmente aleatória por Brianna (Jane Adams) e Andrew Lincoln (Reg Rogers), um casal que resolveu se "divertir" desta maneira');
