INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (160, '2009-03-24 00:00:00', 'Deu a Louca na Branca de Neve', 'A versão “escrachada” do conto de fadas famoso é uma continuação de “Deu a Louca na Cinderela” (”Happily N´Ever After”), em que a protagonista mostrava seus cabelos curtinhos e se chamava Ella. O caso de Branca de Neve é bem parecido, com direito a madrasta má e a uma maçã envenenada, mas mostrados de um jeito cômico. Os sete anões também fazem parte da trama.');
