INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (172, '2004-08-09 00:00:00', 'Dracula 3000', 'No ano 3000, o navio de salvamento do espaço profundo, a Mãe III, localiza a nave estilhaçada Deméter no Sistema dos Cárpatos. O capitão Abraham Van Helsing e sua tripulação composta pela assistente loira Aurora Ash; o aleijado navegador Arthur "The Professor" Holmwood, que acredita ser um gênio; o forte e mudo Humvee; a estagiária Mina Murry; e o viciado em drogas, 187, decide reivindicar a posse de Deméter. Ao explorar a espaçonave, eles viram uma fita de cinquenta anos atrás do capitão Varna dizendo que ele estava trancado em sua cabine desde que sua tripulação estava agindo de forma estranha depois de pegar uma carga de caixões na estação da Transilvânia. Quando 187 decide procurar nos caixões alguma droga escondida, ele corta a mão e seu sangue desperta Conde Orlock, também conhecido como Conde Drácula. Quando Aurora revela quem é Drácula, os sobreviventes tentam encontrar uma maneira de destruir o vampiro');
