INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (183, '1999-10-12 00:00:00', 'Warlock 3: O Fim da inocencia', 'Um bruxo perverso, mas aparentemente charmoso, atrai um grupo de amigos para um esconderijo remoto onde ele sadicamente manipula suas fraquezas e prazeres sexuais. À medida que cada um deles é vencido por sua diabólica influência, fica claro que ele só deseja um deles – uma jovem descendente da família que tentou destruí-lo há mais de 300 anos.');
