INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (191, '2008-09-12 00:00:00', 'Sem Saída', 'Steve planejou um fim de semana romântico com sua namorada Jenny, à beira de um belo lago, onde pretende pedir a mão dela em casamento. Logo que chegaram, foram incomodados pela presença de adolescentes arruaceiros, que não gostaram nem um pouco dos visitantes. Depois de um acidente entre os grupos, o líder da gangue adolescente, Brett, instiga seus amigos a apedrejar o carro do casal e segui-los pela floresta.');
