INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (198, '2010-11-05 00:00:00', '127 Horas', '"127 Horas" conta a história verídica da impressionante aventura do montanhista Aron Ralston (James Franco), e a sua luta ao ficar preso após uma queda num desfiladeiro isolado no Utah. Durante os cinco dias seguintes Ralston examina a sua vida e sobrevive aos elementos para finalmente descobrir que tem a coragem e os recursos para se libertar por qualquer meio necessário, escalar uma parede com 200m e caminhar mais de 12km antes de ser finalmente salvo. Ao longo da sua viagem, Ralston recorda amigos, amantes (Clémence Poésy), família e as duas caminhantes (Amber Tamblyn e Kate Mara) que conheceu antes do acidente.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (199, '2009-04-22 00:00:00', 'Coco Antes de Chanel', 'Filme-biografia que mostra a juventude da estilista Chanel e sua fase de aprendizado, além de sua infância no orfanato, o começo de sua vida como modista antes da glória e seus primeiros sucessos. Uma vida cheia de amores e desaforos, intuição e ousadia, muitas verdades ou apenas fantasias são promessas para o documentário.');
