INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (204, '1953-12-22 00:00:00', 'Os Cavaleiros da Távola Redonda', 'O recém coroado rei da Inglaterra, Arthur Pendragon dedica seu reinado e a irmandade dos Cavaleiros da Távola Redonda aos ideais de paz e justiça. Apoiando o Rei Arthur em seus objetivos está a sua amada Rainha Guinevere, o nobre Sir Lancelot e o misterioso Merlin. Lancelot e Guinevere estão divididos entre a secreta paixão que os envolve e a lealdade e respeito que nutrem por Arthur. Mas essa traição não é nada se comparada ao ódio que a feiticeira Morgana, meia irmã de Arthur, e seu filho Mordred sentem pelo Rei de Camelot.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (205, '2009-12-18 00:00:00', 'Dupla Identidade', 'Um médico americano que trabalha para Médicos Sem Fronteiras no Leste Europeu, Dr. Nicholas Pinter (Val Kilmer), é erroneamente identificado pela máfia russa como sendo um agente secreto. Depois de uma violenta perseguição por dois mafiosos, ele consegue escapar da morte e é resgatado pelo Serviço Secreto Britânico e pela bela e misteriosa Katrine (Izabella Miko). Nicholas logo percebe que o jogo mortal está apenas começando quando ele e Katrina se envolvem numa perigosa rede de mentiras e assassinatos');
