INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (226, '1993-01-21 00:00:00', 'Stalingrado - A Batalha Final', 'Segunda Guerra Mundial, 1942. O filme traz um retrato da Batalha de Stalingrado vista pelos olhos dos alemães.  A história segue um grupo de soldados alemães, desde o fronte italiano no verão de 1942 até as estepes congeladas da Rússia soviética e terminando com a batalha por Stalingrado. Através deles são mostrados os horrores da guerra, o medo, a esperança e todas as emoções dos combatentes envolvidos. Uma descrição da brutal batalha de Stalingrado, a "Waterloo" do Terceiro Reich, vista pelos olhos do oficial alemão Hans von Witzland e por seu batalhão.');
