INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (231, '2011-01-12 00:00:00', 'O Besouro Verde', 'Britt Reid (Seth Rogen) está perto dos 30 anos e não quer saber de responsabilidades, dedicando sua vida à diversão. Até o dia em que seu pai (Tom Wilkinson) morre misteriosamente e ele precisa assumir os negócios da família, ficando à frente de um grande e respeitado jornal. Milionário e entediado, Reid resolve criar um personagem junto com seu fiel funcionário Kato (Jay Chou), fera das artes marciais e grande inventor de máquinas revolucionárias. Cheios de vontade, surge então o Besouro Verde. Só que a cidade está nas garras de Chudnofsky (Christoph Waltz), um criminoso que busca meios der ser mais ameaçador para as pessoas.');
