INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (235, '1992-07-04 00:00:00', 'Supercop - Police Story 3', 'Detetive durão da polícia de Hong Kong, perito em artes marciais, infiltra-se em organização mafiosa para desmascarar seus chefões. É recrutado para uma missão para acabar com o tráfico de drogas internacioanl. Michelle Yeoh, é a sua parceira neste filme, e juntos se disfarçam de bandidos para acabar com o tráfico de entorpecentes, de Hong Kong, das selvas da Tailândia até as ruas da Malásia. O personagem de Jackie Chan foi apelidado de "Supercop" por seus colegas após exterminar com os bandidos nos dois primeiros filmes da série.');
