INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (239, '2004-10-22 00:00:00', 'Contra Corrente', 'Chris (Jamie Bell) e Tim (Devon Alan) são dois irmãos que moram com o pai (Dermot Mulroney), em uma cidade no sul dos Estados Unidos. A chegada de Deel (Josh Lucas), tio ex-presidiário, muda completamente a vida de todos. Ao tentar se apossar de uma coleção de velhas moedas mexicanas, Deel mata a sangue frio seu próprio irmão. Testemunhas, Chris e Tim fogem com as moedas, mas esquecem a arma do crime. Eles passam então a fugir da polícia e também de Deel, que deseja matá-los a todo custo.');
