INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (253, '1981-10-01 00:00:00', 'A Tragédia de um Homem Ridículo', 'Um industrial de laticínios na Bassa Padana (Vale do Pó) vê seu filho de 20 anos ser sequestrado em seu aniversário. Ele tenta entrar em contato com os sequestradores, mas pouco a pouco ele se convence de que seu filho foi morto. Então o homem decide tentar uma farsa. Os bilhões que ele coletou entre os agiotas servirão para salvar sua empresa que está indo à falência. (e 10 - Estimado 10 Anos)');
