INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (257, '2009-02-06 00:00:00', 'Cadê a Minha Entrega?', 'Um entregador descuidado faz a entrega de um pacote de droga pura em um endereço errado. Dois amigos abrem a caixa e acreditam ter tirado a sorte grande. Imediatamente eles vendem a droga para um primo traficante, tentando lucrar um bom dinheiro. Esse é ponto de partida para uma ação desenfreada, uma verdadeira corrida contra o tempo quando vários personagens, entre eles o entregador, os receptores e os traficantes, cada um com objetivos diferentes, saem em uma busca alucinante atrás do tal pacote.');
