INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (264, '1994-07-15 00:00:00', 'Os Anjos Entram em Campo', 'Roger é um filho adotivo cujo pai irresponsável promete se organizar quando o time de beisebol favorito de Roger, o California Angels, ganhar a flâmula. O problema é que os Anjos estão em último lugar, então Roger pede ajuda para transformar a equipe. Com certeza, suas orações são respondidas na forma de anjo Al.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (265, '1997-05-02 00:00:00', 'Guerreiros da Virtude', 'Numa distante terra mágica, o menino Ryan, ajuda os cinco guerreiros cangurus, guardiões do Reino de Tao, a defender a última fonte da vida das más intenções do diabólico Komodo.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (266, '2007-08-26 00:00:00', 'In The Spider''s Web', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (267, '2008-04-08 00:00:00', 'Dia dos Mortos', 'Refilmagem do classico de George A. Romero. "Dia dos Mortos" mostra as consequências de um ataque terrorista biológico na cidade de Leadville, que é isolada, sem poder ter nenhum contato com o mundo lá fora. Mas este ataque é apenas o começo do terror. Os infectados pela toxinas se transformaram em zumbis que se alimentam de carne humana. Um grupo de sobreviventes se refugia em uma base militar, mas alguns podem ter se contaminadoe as suspeitas e o medo crescem. Tudo piora quando o estoque de água e comida começa a se esgotar. A única maneira de sobreviver a este pesadelo é descobrir o antídoto para este mal antes que os mortos vivos os capturem. Começa uma batalha pela vida, nos dias mais horripilantes que o mundo já viu.');
