INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (274, '2008-10-31 00:00:00', 'Os Invasores da Cidade Perdida', 'Grande parte da massa terrestre do mundo perdeu-se com "A Ascensão" e está agora submersa.40 anos após aos efeitos cumulativos do aquecimento global, as principais cidades costeiras desapareceram ou ficaram parcialmente submersas, deixando a metade superior da Estátua da Liberdade em Nova Iorque como único resto visível, a placa de Hollywood em Los Angeles, pouco acima da linha marítima do horizonte, a Torre Eiffel de Paris meia submersa e a Montanha do Pão de Açúcar no Rio de Janeiro uma mera colina, sentada no mar.
