INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (284, '1985-09-04 00:00:00', 'ギニーピッグ 悪魔の実験', 'Guinea Pig é uma série de seis filmes japoneses do estilo "gore" (filmes que apresentam depravações visuais) confundido várias vezes com o estilo "snuff" (filmes onde pessoas são mortas de verdade). A confusão se deu pelo fato de o filme ser um esforço de estudantes de cinema do Japão que pesquisavam efeitos especiais, e eram realmente bons no que faziam, tanto que quando o primeiro filme foi lançado os realizadores foram presos e tiveram que provar que ninguém foi machucado de verdade para as filmagens. Guinea Pig é assustador, mas pode ser entendido como um exemplo da qualidade de efeitos especiais numa era onde a computação gráfica substituiu a criatividade.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (285, '2002-02-21 00:00:00', '666 - Traue keinem, mit dem Du schläfst!', '');
