INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (288, '2011-06-06 00:00:00', 'A Noiva Isca', 'A bela e famosa atriz Lara Tyler (Alice Eve) e o autor de um livro só James Arber (David Tennant) desejam se casar longe dos olhos da imprensa. O plano da vez é realizar a cerimônia secreta na pacata ilha Hegg, na costa escocesa e Katie (Kelly Macdonald), moradora local desiludida com o amor, é contratada para enganar os paparazzi, mas acaba se casando de verdade com James.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (289, '1953-02-05 00:00:00', 'As Aventuras de Peter Pan', 'Deixando o conforto e segurança de seus lares, Wendy, Miguel e João seguem Peter Pan para um mundo mágico onde a infância dura para sempre, a Terra do Nunca. Mas logo as crianças descobrem que precisarão confrontar o terrível Capitão Gancho, um maquiavélico pirata que quer se livrar de uma vez por todas de Peter.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (290, '2006-12-08 00:00:00', 'A Cor do Perdão', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (291, '1961-06-06 00:00:00', 'O Último Pôr-Do-Sol', 'O caubói Brendan O''Malley (Kirk Douglas) chega à casa da formosa Belle Breckenridge (Dorothy Malone), casada com bruto beberrão John Becheridge (Joseph Cotten). O casal está se preparando para iniciar uma jornada com o gado até o Texas.Na cola de O''Malley está o policial Dana Tribling (Rock Hudson), que tem razões pessoais para capturá-lo. Ambos se juntam ao casal em sua jornada, mas as tensões aumentam quando John nota o crescente interesse de dana por sua mulher e de Brendan por sua filha...');
