INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (321, '2001-10-26 00:00:00', 'O Homem que Não Estava Lá', 'Em meio aos anos 40, Ed Crane (Billy Bob Thornton) é um barbeiro infeliz, que vive com sua esposa Doris (Frances McDormand). Ao descobrir que ela o está traindo, Ed passa então a planejar uma trama de chantagem contra ela, a fim de ensinar-lhe uma lição. Mas quando seu plano vai por água abaixo uma série de consequências desagradáveis ocorrem, incluindo vários assassinatos.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (322, '1969-06-04 00:00:00', 'Minha Noite Com Ela', 'O narrador (Jean-Louis), um católico devoto, se muda para uma cidade provinciana e se apaixona por uma linda loira que ele vê na rua. Vidal, um velho amigo de escola, convida-o a visitar Maud, uma mulher divorciada com uma personalidade descomunal. Os princípios rígidos de um homem católico devoto são desafiados durante uma estadia de uma noite com Maud, tendo discussões filosóficas em seu quarto. Na manhã seguinte, o engenheiro narrador encontra a linda loira Françoise e consegue marcar um jantar com ela.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (323, '1992-01-01 00:00:00', 'Barbarian Queen II: The Empress Strikes Back', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (324, '1997-09-12 00:00:00', 'Em Busca do Vale Encantado V', 'Além do Vale Encantado existe uma ilha de beleza e mistério. Neste lugar maravilhoso, Littlefoot, Saura, Espora, Patassaura e Petrúcio descobrirão velhos e novos amigos, enfrentarão incríveis desafios e viverão a maior aventura de suas vidas! É a mais nova história recheada de canções do clássico Em Busca do Vale Encantado. Um dia, uma nuvem de insetos devoradores de plantas desce sobre o Vale Encantado, e acabam com todas as folhinhas à vista. Agora, o Vale está totalmente destruído e todos precisam buscar um novo lar até que as plantas cresçam novamente. Mas quando as brigas entre os adultos ameaçam separa-los, Littlefoot e seus amigos resolvem partir sozinhos. Em sua busca, eles encontram, as Grandes Águas – onde estranhas criaturas vivem e nadam – que os levam à uma misteriosa ilha onde eles encontram Chomper, o adorável amigo de dentes afiados de “A Grande Aventura no Vale”. Porém, agora Chomper precisa proteger seus amiguinhos das feras, incluindo seus próprios país!');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (325, '1905-01-01 00:00:00', 'Le diable noir', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (326, '1979-01-25 00:00:00', 'Családi tűzfészek', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (327, '2006-12-26 00:00:00', 'Coisas de Meninos e Meninas', 'Vizinhos desde criança, Woody e Nell não poderiam ser mais diferentes. Ela é estudiosa, ele é um atleta. Eles sempre pegaram um no pé do outro, até que um dia trocam de personalidade como em um passe de mágica. Muita confusão vai rolar até eles descobrirem como desfazer essa troca!');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (328, '1996-06-26 00:00:00', 'Gabbeh', 'Produção iraniana sobre um casal idoso que segue sua rotina de limpar o gabbeh, um tapete com um desenho intrincado. Magicamente, uma jovem aparece e passa a ajudar os dois. Ela pertence ao clã cuja história é narrada nas imagens do tapete, especialmente o romance que envolveu a tal jovem e um estranho do clã.');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (329, '2001-09-28 00:00:00', 'Extreme Days', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (330, '2005-08-26 00:00:00', 'Dirty Deeds', '');
INSERT INTO FILME (IDFILME, DATALANCAMENTO, NOMEFILME, DESCSINOPSEFILME) VALUES (331, '2004-01-20 00:00:00', 'O Silêncio de Melinda', 'Após ser agredida numa festa, estudante recorre à polícia, mas ainda sob o impacto do trauma, não consegue relatar os fatos como realmente aconteceram. Estigmatizada na escola e sem o apoio da família, a jovem mergulha num mundo de silêncio e dor.');
